import React from 'react';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';

const numbers = [
    'one',
    'two',
    'three',
];

export default function BgExample() {
    return (
        <Grid 
            container 
        >
            <Grid 
                item
                xs={4}
            >
                <ButtonGroup 
                    color='primary' 
                    aria-label='buttons group' 
                    orientation='vertical'
                >
                    {numbers.map((num, index) => {
                        return (
                            <Button 
                                key={index.toString()} 
                            >
                                {num}
                            </Button>
                        )
                    })}
                </ButtonGroup>
            </Grid>
            <Grid 
                item 
                xs={4} 
            >
                <ButtonGroup 
                    variant='contained' 
                    color='primary' 
                    orientation='vertical' 
                    aria-label='buttons grouped'
                >
                    {numbers.map((num, index) => {
                        return (
                            <Button 
                                key={index.toString()} 
                            >
                                {num}
                            </Button>
                        )
                    })}
                </ButtonGroup>
            </Grid>
            <Grid 
                item 
                xs={4} 
            >
                <ButtonGroup 
                    color='primary' 
                    variant='text' 
                    orientation='vertical' 
                    aria-label='buttons grouped' 
                >
                    {numbers.map((num, index) => {
                        return (
                            <Button 
                                key={index.toString()} 
                            >
                                {num}
                            </Button>
                        )
                    })}
                </ButtonGroup>
            </Grid>
        </Grid>
    );
}
